The default JWT secret is weak and poses a security risk. Consider throwing an error if JWT_SECRET is not set in production rather than using a default value.
```suggestion
let JWT_SECRET: string | undefined = process.env.JWT_SECRET;
if (!JWT_SECRET) {
  if (process.env.NODE_ENV === 'production') {
    throw new Error('JWT_SECRET environment variable must be set in production');
  } else {
    JWT_SECRET = 'your-super-secret-jwt-key-change-this-in-production';
  }
}
